　ハンディーなハイドレーション<br>

スピードを競うスポーツの世界では、迅速なハイドレーションが不可欠。このフラスクは 1/4 回転で閉められる大きなキャップが特徴で、簡単に素早く水分を補給できます。<br>

■サイズ：26×6×5cm<br>

